import './Dashboard.css';

function Dashboard() {
  return (
    <div className="page-container">
      <h1>Dashboard</h1>
      <p>Selamat datang di halaman Dashboard A9 Game!</p>
      <p>Gunakan menu navigasi di atas untuk mulai bermain atau menjelajahi game lainnya.</p>
    </div>
  );
}

export default Dashboard;
